            pto: req.body.pto,
            numero: req.body.numero,
            clienteid: req.body.clienteid,
            total: req.body.total
        }).then((result) => {
            let items = req.body.items.map( item => {
                return Item.create({
                    idfact: result.id,
                    idprod: item.idprod,    
                    cant: item.cant, 
                    codigo: item.codigo, 
                    descripcion: item.descripcion, 
                    precio: item.precio,
                    iva: item.iva, 
                    subtotal: item.subtotal
                })
            })
            Promise.all(items).then(
                res.status(201).json({
                   result
                })
            )
        }).catch((err) => {
            console.log(err)
            res.status(401).json({
                error: err.message
            })
        });
    }catch(e){
        res.status(500).json(
            {error:  e.message}
        )
    }
}

